import { Modal } from 'react-bootstrap';

class LoginAndSignUp extends Component {
    render() {
        return (
            <div>
                <Modal show={true} centered>
                    <Modal.Header closeButton>

                    </Modal.Header>
                    <Modal.Body>
                        Hello
                    </Modal.Body>
                </Modal>
            </div>
        );
    }
}

export default LoginAndSignUp;
